(16,1,"2018-03-27 01:10:36","2018-03-27 01:10:36","<h1>Our Vision</h1>\r\nAn individual’s previous criminal justice involvement doesn’t determine their life’s narrative.\r\n\r\n<h1>Our Mission</h1>\r\nTo teach men and women with criminal justice involvement web development skills to establish a foundation for gainful employment and to live successfully in their communities. We understand employment is a vital determinant of quality of life, and our mission reflects our deep passion and strategic commitment to empower individuals with previous involvement in the criminal justice system to obtain valuable, high-demand programming skills – to become community leaders, advocates for justice, and engaged citizens whose life’s narrative is not defined by their criminal justice involvement. \r\n\r\n<h4>Want to stay up to keep up with our latest updates? Contact us <a href=\"https://hackthenarrative.local/contact/\">here</a>.</h4>","Hack The Narrative","","publish","closed","closed","","hack-the-narrative","","","2018-03-27 02:25:35","2018-03-27 02:25:35","",0,"https://hackthenarrative.local/?page_id=16",0,"page","",0),
